import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import { 
  Typography, 
  Button, 
  Paper, 
  Grid,
  Box,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem
} from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import SaveIcon from '@mui/icons-material/Save';

const DepartmentForm = () => {
  const navigate = useNavigate();
  const { id } = useParams();
  const isEditing = !!id;

  const [formData, setFormData] = useState({
    name: '',
    manager: '',
    description: '',
    budget: '',
    location: ''
  });

  useEffect(() => {
    if (isEditing) {
      // Simulando busca de dados do departamento
      // Em um caso real, aqui seria feita uma chamada à API
      setFormData({
        name: 'TI',
        manager: 'Carlos Santos',
        description: 'Departamento responsável pela infraestrutura e desenvolvimento de sistemas',
        budget: '500000',
        location: 'Andar 3'
      });
    }
  }, [isEditing, id]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      console.log('Dados do formulário:', formData);

      // Importar o serviço da API
      const { departmentService } = await import('../../services/api');

      if (isEditing) {
        // Atualizar departamento existente
        await departmentService.updateDepartment(id, formData);
        console.log('Departamento atualizado com sucesso');
      } else {
        // Criar novo departamento
        await departmentService.createDepartment(formData);
        console.log('Departamento criado com sucesso');
      }

      // Redirecionar após salvar
      navigate('/departments');
    } catch (error) {
      console.error('Erro ao salvar departamento:', error);
      // Aqui você pode adicionar uma notificação de erro para o usuário
    }
  };

  return (
    <div>
      <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
        <Box display="flex" alignItems="center">
          <Button 
            startIcon={<ArrowBackIcon />} 
            onClick={() => navigate('/departments')}
            sx={{ mr: 2 }}
          >
            Voltar
          </Button>
          <Typography variant="h4" component="h1">
            {isEditing ? 'Editar Departamento' : 'Novo Departamento'}
          </Typography>
        </Box>
      </Box>

      <Paper elevation={3} sx={{ p: 3 }}>
        <Box component="form" onSubmit={handleSubmit}>
          <Grid container spacing={3}>
            <Grid item xs={12} md={6}>
              <TextField
                fullWidth
                label="Nome do Departamento"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                fullWidth
                label="Gestor Responsável"
                name="manager"
                value={formData.manager}
                onChange={handleChange}
                required
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Descrição"
                name="description"
                value={formData.description}
                onChange={handleChange}
                multiline
                rows={3}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                fullWidth
                label="Orçamento Anual"
                name="budget"
                type="number"
                value={formData.budget}
                onChange={handleChange}
                InputProps={{ startAdornment: 'R$ ' }}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                fullWidth
                label="Localização"
                name="location"
                value={formData.location}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={12}>
              <Box display="flex" justifyContent="flex-end" mt={2}>
                <Button 
                  variant="contained" 
                  color="primary" 
                  type="submit"
                  startIcon={<SaveIcon />}
                >
                  Salvar
                </Button>
              </Box>
            </Grid>
          </Grid>
        </Box>
      </Paper>
    </div>
  );
};

export default DepartmentForm;
